import React from 'react';

const PropsCompo2 = (props) => {

    let name = props.name;
    let age = props.age;
    let addr = props.addr;

    return (
        <div className="PropsCompo2">
            <string>속성을 갖는 컴포넌트</string>
            <p>
                이름 : {name}님<br />
                나이 : {age}살<br />
                주소 : {addr}시<br />
            </p>
        </div>
    );
};

export default PropsCompo2;
